import { Action } from "@reduxjs/toolkit";

const InitialState = {
  count: 1,
};

const reducerTest = (state = InitialState, action: Action) => {
  switch (action.type) {
    case "counter/increment":
      return { state: state.count + 1 };

    default:
      return state;
  }
};

export default reducerTest;
